import '../App.css';
import Button from 'react-bootstrap/Button';

function Home() {
  return (
    <div className="Home">
        <header>
            <p>Транспонатор нот</p>
            <Button variant="primary">Вход</Button>
            <Button variant="primary">Регистрация</Button>
        </header>
    </div>
  );
}

export default Home;
